{
    return vovn(100,0,n);
}
boolean non1(unsigned int n1, unsigned int n2)
{
    return noun1==n1||noun1==n2;
}
boolean cvn(unsigned int v, unsigned int n)
{
    return verb==v&&noun1==n;
}
boolean cvn70(EFFSHORTINDEX n) FASTCALL
{
    return cvn(70,n);
}
boolean cva(unsigned int v, unsigned int n)
{
    return verb==v&&actor==n;
}
boolean cva75(EFFSHORTINDEX n) FASTCALL
{
    return cva(75,n);
}
boolean cva70(EFFSHORTINDEX n) FASTCALL
{
    return cva(70,n);
}
boolean cvna(unsigned int v, unsigned int n, unsigned int o)
{
    dummy=get_object_position(o);
    return verb==v&&noun1==n&&(dummy==current_position||dummy==CARRIED);
}
boolean cvna70(EFFSHORTINDEX n, EFFSHORTINDEX o)
{
   return cvna(70,n,o);
}
